import { ReactElement, useEffect, useState } from "react";
import { namespace } from "./interfaces";
import api from "./services/api";

export default function App() {
  const [users, setUserGet] = useState([]);
  const elementUsers : Array<ReactElement> = [];
  let cont = 0;


  useEffect(() => {
   api
     .get("/v1/Users")
     .then((response) => ((setUserGet(response.data))))
     .catch((err) => {
       console.error("ops! ocorreu um erro" + err);
     });
  }, []);

  users.forEach((e: namespace.IUser) => {
    elementUsers.push(<div className="usuariosInfo" key={e.id}>
                        <p> <strong>Nome:</strong> {e.name} </p>
                        <p> <strong>Id:</strong> {e.id} </p> 
                        <p> <strong>Telefone:</strong> {e.account.ocurrenceRecords[0].amount} </p>
                      </div>
                  ) 
  })

  return (
    <div className="App">
      {elementUsers}
    </div>  
  );
}
